    description:
      '\u003cdiv id="kl_wrapper_3" class="kl_box_left kl_wrapper byuo_cs"\u003e\n\u003cdiv id="kl_banner"\u003e\n\u003ch2\u003e\u003cspan id="kl_banner_left"\u003e \u003cspan class="kl_mod_text kl_current_module_name"\u003e- \u003c/span\u003e \u003c/span\u003e \u003cspan id="kl_banner_right"\u003eProgramming Exam Note Sheet\u003c/span\u003e\u003c/h2\u003e\n\u003c/div\u003e\n\u003cdiv id="kl_custom_block_0"\u003e\n\u003ch3\u003eNote Sheet\u003c/h3\u003e\n\u003cp\u003eYou may use a single piece of paper (front and back) or a 2 page PDF of non-specific notes on the programming exam.\u0026nbsp;\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eAllowed: non-project-specific notes.\u003c/li\u003e\n\u003cli\u003eNOT Allowed: project-specific notes or project code.\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003eIf you can tell which project it is for, it\'s too specific! A general rule to follow: if it can be found in the javadocs, it\'s safe. For example, how to initialize a HashMap and put data inside it is acceptable. However, using a given specific algorithm to swap two letters in a string is two specific. When in doubt, ask the TA\'s! We are here to help.\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003e\u003cspan\u003ePAPER NOTES:\u0026nbsp;You may use a single piece of paper (front and back) of non-specific notes on the programming exam.\u003c/span\u003e\n\u003cul\u003e\n\u003cli\u003e\u003cspan\u003eWhen asked to show your notes, carefully show every part of your sheet (front and back) to the webcam so we can ensure it\'s the same as the approved.\u003c/span\u003e\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003cli\u003e\u003cspan\u003ePDF NOTES: You may use 2 pages of notes. Minimum of 11 pt font and normal margins.\u0026nbsp;\u003c/span\u003e\n\u003cul\u003e\n\u003cli\u003e\u003cspan\u003eWhen asked to show your notes, carefully and slowly (slow enough to quickly read) scroll through your 2 pages of notes.\u003c/span\u003e\u003c/li\u003e\n\u003c/ul\u003e\n\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp class="bs-alert bs-alert-primary"\u003e\u0026nbsp;In order to use these notes on the programming exam, these notes must be TA approved.\u003c/p\u003e\n\u003ch3\u003eGetting Your Notes Approved\u003c/h3\u003e\n\u003col\u003e\n\u003cli\u003eUpload pictures of both sides of the paper (as clear as possible, so we can see everything)\u003c/li\u003e\n\u003cli\u003eGet on the help queue with a message along the lines of "approving notes for programming exam" with your zoom information. For our convenience, if your queue name doesn\'t include your first and last name (as seen in the grade book), include that info or your netid.\u003c/li\u003e\n\u003cli\u003eWhile on the zoom call with a TA, they will either approve your notes, or not. If they do, they will update your grade to 1/1, which means these exact notes are approved! If they do not approve, they will tell you why, and what you need to remove.\u003c/li\u003e\n\u003cli\u003eYou can repeat this process until you get your notes sheet approved, using the TA\'s suggestions each time.\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp class="bs-alert bs-alert-primary"\u003eNote, we will not approve notes during an exam. You must get notes approved prior to starting the exam.\u003c/p\u003e\n\u003cp\u003e\u003cspan\u003eYou will be asked to show the same sheet of notes (front \u0026amp; back) at the beginning of your exam to your webcam.\u0026nbsp;\u003c/span\u003e\u003c/p\u003e\n\u003cp\u003e\u003cspan\u003eIf you use notes, but haven’t been pre-approved, or use different notes than uploaded, you will \u003c/span\u003e \u003cspan\u003eautomatically fail the exam.\u0026nbsp;\u003c/span\u003e\u003c/p\u003e\n\u003c/div\u003e\n\u003cdiv id="kl_custom_block_1" class=""\u003e\n\u003cp\u003e\u0026nbsp;\u003c/p\u003e\n\u003cp class="kl_module_progress_completion" style="display: none;"\u003eModule Item Completion (built in browser, hidden in app)\u003c/p\u003e\n\u003cp\u003e\u0026nbsp;\u003c/p\u003e\n\u003c/div\u003e\n\u003c/div\u003e',
