        lock_explanation: "This topic was locked Sep 24 at 11:59pm.",
        message:
          '\u003cdiv id="kl_wrapper_3" class="kl_emta kl_wrapper"\u003e\n\u003cdiv id="kl_banner" class="" style="border-width: 0px;"\u003e\n\u003ch2 class=""\u003e\u003cspan id="kl_banner_left" class="" style="background-color: #bad3ec; color: #ffffff;"\u003e\u003cspan class="kl_mod_num"\u003e\u003cbr\u003e\u003c/span\u003e \u003c/span\u003e \u003cspan id="kl_banner_right" style="background-color: #bad3ec; color: black;"\u003eWeek 4 Discussion Board--Quantitative Graphs (Lessons 7-9)\u003c/span\u003e\u003c/h2\u003e\n\u003c/div\u003e\n\u003c/div\u003e\n\u003cp\u003eTo earn full points on this assignment, you\'ll need to make two posts in this Discussion Board by their due dates (listed on the course schedule). Your initial post is due on \u003cem\u003e\u003cstrong\u003eWednesday\u003c/strong\u003e\u003c/em\u003e and your response post is due on \u003cem\u003e\u003cstrong\u003eFriday\u003c/strong\u003e\u003c/em\u003e of Week 4. Don\'t procrastinate! Posting later means the assignment will take you longer since you\'ll have to read through more posts to ensure that you haven\'t duplicated what someone else has \u003cspan\u003esaid. If there are different prompts depending on whether you are the first or second person to respond, the second prompt is usually a little more difficult that the first prompt. Be sure to refresh the Discussion Board after making your posts to verify that nobody posted ahead of you while you were typing!\u003c/span\u003e\u003c/p\u003e\n\u003cp\u003e\u003cspan\u003eIf you have any questions about how to complete this assignment, email Tiffany at \u003ca href="mailto:hilton@stat.byu.edu," target="_blank"\u003ehilton@stat.byu.edu,\u003c/a\u003e attend her office hours, ask in an open or Active Learning lab, or message your TA. Remember to check the rubric to see how you\'ll be graded!\u003c/span\u003e\u003c/p\u003e\n\u003cp\u003e\u0026nbsp;\u003c/p\u003e\n\u003ch3 style="background-color: #f2f2f2; color: #000000; padding-top: 0px; padding-right: 10px; padding-left: 10px; margin-top: 20px; margin-bottom: 20px;"\u003eInitial Post\u003c/h3\u003e\n\u003cp\u003e\u003cem\u003e\u003cstrong\u003eThis Discussion Board is designed to help you more fully understand the concepts behind these frequently missed Exam 1 Learning Outcomes:\u003c/strong\u003e\u003c/em\u003e \u003cspan style="color: #3598db;"\u003e\u003cstrong\u003eInterpret plots by describing shape, center, spread and presence of outliers; \u003c/strong\u003e\u003cstrong\u003eFrom the plot of a given data set, determine an appropriate measure of center.\u003c/strong\u003e\u003c/span\u003e\u003c/p\u003e\n\u003cp\u003eFind an appropriate graph for quantitative data. Embed (do not attach) it in your post by choosing the "Insert" option above the textbox. Then, select "Image"\u0026gt;"Upload Image" and drag and drop a picture of the graph. \u003cspan\u003eYour picture should be a .jpg or .png format to embed properly. \u003c/span\u003eState what type of graph you\'ve shared. Be sure it\'s one of the graphs we discussed in Lesson 7 or Lesson 9. Be sure your graph is not the same as anyone else\'s who posted before you.\u003c/p\u003e\n\u003cp\u003e\u0026nbsp;\u003c/p\u003e\n\u003ch3 style="background-color: #f2f2f2; color: #000000; padding-right: 10px; padding-left: 10px; margin-top: 20px; margin-bottom: 20px;"\u003eResponse Post\u003c/h3\u003e\n\u003cp\u003e\u003cspan\u003eOnly two people may respond to the same initial post.\u003c/span\u003e\u003c/p\u003e\n\u003cp\u003eIf you are the \u003cem\u003e\u003cstrong\u003efirst\u003c/strong\u003e\u003c/em\u003e person to respond, identify the shape of the distribution shown in the given graph. State whether the mean or median will be larger or if they are approximately equal.\u0026nbsp;\u003c/p\u003e\n\u003cp\u003eIf you are the \u003cem\u003e\u003cstrong\u003esecond\u003c/strong\u003e\u003c/em\u003e person to respond, identify the best measure of center for the distribution based on the shape given by the first person to respond. Also, answer one of the following questions, depending on the type of graph given:\u003c/p\u003e\n\u003cul style="list-style-type: circle;"\u003e\n\u003cli\u003eHistogram/Stemplot/Dotplot: What percent of values are in the first two bars/stems/stacks of dots? Show your work for your calculation.\u003c/li\u003e\n\u003cli\u003eBoxplot: What is the 5-number summary for the data set?\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003eNote: Depending on how well the graph is labeled, you may need to estimate these values. That is fine as long as your answer is reasonable.\u003c/p\u003e',
